    def is_valid(grammar, string):
        """Checks if a string is valid according to the given grammar."""
        stack = []
        for char in string:
            if char in grammar.symbols:
                stack.append(char)
            elif char in grammar.productions:
                if not stack:
                    return False
                top = stack.pop()
                if grammar.productions[top] != string:
                    return False
        return not stack

    if is_valid(s, s):
        print("Yes")
    else:
        print("No")

